import { Box, Container, Stack } from "@mui/material";
import { Images } from "../Constants/images";

const Home = () => {
  const containerStyles = {
    backgroundColor: "blue", // Set the background color to blue
  };

  const Styles = {
    backgroundImage: `url(${Images.BG})`,
    backgroundSize: "cover",
    backgroundRepeat: "no-repeat",
    height: "100%",
    width: "100%",
  };

  return (
    <section className="h-screen w-screen">
      <div style={Styles}>
        <Container maxWidth="lg" style={containerStyles}>
          <div className="bg-primarycolor w-[100%] h-[100%] text-white">
              <Stack direction={"column"} style={{ width:"100%", height:"700px"}}>
                <div className="my-[100px]">
                  <h1 className="font-hometext text-center text-5xl">Your journey begins here</h1>
                </div>
                <div>
                  <div style={{ width:"100%", height:"400px", backgroundColor:"white" }} className="rounded-lg">
                    <Stack direction={"column"}>
                      <div>
                        <h1>hiis</h1>
                      </div>
                      <Stack direction={"row"}>
                        <div></div>
                        <div></div>
                        <div></div>
                      </Stack>
                    </Stack>
                  </div>
                </div>
              </Stack>
          </div>
        </Container>
      </div>
    </section>
  );
};

export default Home;
